CREATE TABLE IF NOT EXISTS `entity_links` (
  `id`                BIGINT(20)   NOT NULL AUTO_INCREMENT,
  `version`           BIGINT(20)   NOT NULL,
  `linkId`            VARCHAR(36)  NOT NULL,
  `arch_short_name`   VARCHAR(100) NOT NULL,
  `arch_version`      VARCHAR(100) NOT NULL,
  `name`              VARCHAR(255) DEFAULT NULL,
  `description`       VARCHAR(255) DEFAULT NULL,
  `active_start_time` DATETIME DEFAULT NULL,
  `active_end_time`   DATETIME DEFAULT NULL,
  `sequence`          INT(11)      NOT NULL,
  `source_id`         BIGINT(20) DEFAULT NULL,
  `target_id`         BIGINT(20) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `FK3FCDE05DA5B2869` (`source_id`),
  KEY `FK3FCDE05D3EFA2333` (`target_id`),
  CONSTRAINT `FK3FCDE05D3EFA2333` FOREIGN KEY (`target_id`) REFERENCES `entities` (`entity_id`),
  CONSTRAINT `FK3FCDE05DA5B2869` FOREIGN KEY (`source_id`) REFERENCES `entities` (`entity_id`)
    ON DELETE CASCADE
)
  ENGINE =InnoDB
  DEFAULT CHARSET =utf8;

CREATE TABLE IF NOT EXISTS `entity_link_details` (
  `id`    BIGINT(20)    NOT NULL,
  `type`  VARCHAR(255)  NOT NULL,
  `value` VARCHAR(5000) NOT NULL,
  `name`  VARCHAR(255)  NOT NULL,
  PRIMARY KEY (`id`, `name`),
  KEY `FKD2E4DDD9A03946DF` (`id`),
  CONSTRAINT `FKD2E4DDD9A03946DF` FOREIGN KEY (`id`) REFERENCES `entity_links` (`id`)
)
  ENGINE =InnoDB
  DEFAULT CHARSET =utf8;


#
# Migrate act.patientClinicalProblem for OVPMS-1468
#
DROP TABLE IF EXISTS migrate_problems;
CREATE TABLE migrate_problems (
  act_id  BIGINT PRIMARY KEY,
  problem VARCHAR(255),
  code    VARCHAR(255)
);

INSERT INTO migrate_problems (act_id, problem, code)
  SELECT
    a.act_id,
    d.value,
    upper(d.value)
  FROM acts a JOIN act_details d
      ON a.act_id = d.act_id AND d.name = "problem"
  WHERE a.arch_short_name = "act.patientClinicalProblem" AND d.value IS NOT null AND d.value <> "";

UPDATE migrate_problems
SET code = replace(code, " ", "_");

UPDATE migrate_problems
SET code = replace(code, ".", "_");

UPDATE migrate_problems
SET code = replace(code, "&", "_");

UPDATE migrate_problems
SET code = replace(code, "/", "_");

UPDATE migrate_problems
SET code = replace(code, "\\", "_");

UPDATE migrate_problems
SET code = replace(code, "(", "_");

UPDATE migrate_problems
SET code = replace(code, ")", "_");

UPDATE migrate_problems
SET code = replace(code, "*", "_");

UPDATE migrate_problems
SET code = replace(code, ",", "_");

UPDATE migrate_problems
SET code = replace(code, "-", "_");

UPDATE migrate_problems
SET code = replace(code, "[", "_");

UPDATE migrate_problems
SET code = replace(code, "]", "_");

UPDATE migrate_problems
SET code = replace(code, "__", "_");

INSERT INTO lookups (version, linkId, arch_short_name, active, arch_version, code, name, description, default_lookup)
  SELECT
    0,
    UUID(),
    'lookup.diagnosis',
    1,
    '1.0',
    code,
    problem,
    null,
    0
  FROM (SELECT
          code,
          problem
        FROM migrate_problems
        GROUP BY code) a
  WHERE NOT exists(SELECT
                     *
                   FROM lookups e
                   WHERE e.arch_short_name = 'lookup.diagnosis' AND e.code = a.code);

UPDATE acts a,
  migrate_problems p
SET a.reason = p.code
WHERE a.act_id = p.act_id;

DELETE d
FROM acts a,
  act_details d,
  migrate_problems p
WHERE a.act_id = d.act_id AND a.act_id = p.act_id
      AND d.name = "problem";

